import Starts from '../'
function App() {
    return (
      <div className="App w-[100vw] h-[100vh] flex items-center gap-[1vh] justify-center  overflow-y-auto">
            <div className="w-[80vw] h-[80vh] bordertest flex flex-col gap-[1vw]">
                <p className="market-header">Market &#62; Creatine Monohydrate</p>
                <div className="w-full h-[75vh] bordertest flex flex-col gap-[0.5vw]">
                    <p className="market-item-header">Creatine Monohydrate</p>
                    <div className="w-full h-[6vh] iteminfo bordertest flex gap-[0.5vw]">
                        <div className="w-[4.5vw] h-full  iteminfo-price flex items-center">
                            $155 
                        </div>
                    </div>
                </div>
            </div>
      </div>
    );
  }
  
export default App;
